import { Component, OnInit } from '@angular/core';
import { Cv } from 'src/app/models/cv.model';

@Component({
  selector: 'app-addcv',
  template: ` <hclass="center">Créer un CV</hclass=>
  <app-formmcv [cv]="cv"></app-formmcv>`,
})
export class AddcvComponent implements OnInit {
  cv!: Cv;

  ngOnInit(){
    this.cv= new Cv();
  }
}
